// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Complaints {
    struct Document {
        string name;
        string url;
    }
    struct Complaint {
        uint256 id;
        address complainantAddress;
        string title;
        string complainant;
        string contact;
        string details;
        string progress;
        uint256 date;
        uint256 numDoc;
        bool isAssigned;
        address assignedTo;
    }

    uint256 public complaintsCount = 0;
    uint256 public documentsCount = 0;

    mapping(uint256 => Complaint) public complaints;
    mapping(uint256 => mapping(uint256 => Document)) documents;

    // managing officers
    mapping(address => bool) users;

    address public manager;
    // officers complaints mappings
    mapping(address => mapping(uint256 => bool)) public officers;

    constructor() {
        manager = msg.sender;
    }

    modifier onlyManager() {
        require(msg.sender == manager);
        _;
    }

    modifier authenticateOfficer(uint complaint) {
        require(officers[msg.sender][complaint]);
        _;
    }

    function getComplaint(
        uint256 index
    ) public view returns (Complaint memory) {
        return (complaints[index]);
    }

    function isAssigned(uint256 complaint) public view returns(bool){
        return officers[msg.sender][complaint];
    }

    function isOfficer() public view returns (bool){
        return users[msg.sender];
    }

    function authenticate() public view returns (bool) {
        return msg.sender == manager;
    }

    function readComplaintsCount() public view returns (uint256) {
        return complaintsCount;
    }

    function createComplaint(
        string memory _title,
        string memory _complainant,
        string memory _details,
        string memory _contact
    ) public {
        complaintsCount++;
        complaints[complaintsCount] = Complaint(
            complaintsCount,
            msg.sender,
            _title,            
            _complainant,
            _contact, 
            _details,
            "Registered",
            block.timestamp,
            0,false, msg.sender);
    }

    function addProgress(
        uint256 index,
        string memory _progress
    ) public authenticateOfficer(index) {
        complaints[index].progress = string(
            abi.encodePacked(complaints[index].progress, "\n", _progress)
        );
    }

    function assignOfficer(
        uint256 complaint,
        address officer
    ) public onlyManager {
        complaints[complaint].isAssigned = true;
        complaints[complaint].assignedTo = officer;
        users[officer] = true;
        officers[officer][complaint] = true;

    }

    function addDocument(
        uint256 complaint,
        string memory _name,
        string memory _url
    ) public authenticateOfficer(complaint) {
        complaints[complaint].numDoc = complaints[complaint].numDoc + 1;
        documents[complaint][complaints[complaint].numDoc] = Document(
            _name,
            _url
        );
    }

    function getDocument(
        uint256 complaint,
        uint256 document
    ) public view returns (Document memory) {
        return (documents[complaint][document]);
    }
}
